import React from 'react'

export const ListNim = (nimData) => {
    return (
        <>
            <table>
                <tr>
                    <th>No</th>
                    <th>NIM</th>
                    <th>Action</th>
                </tr>
                {nimData.map(( data, index) => {
                    <tr key={index}>
                        <td>{index}</td>
                        <td>{data.nim}</td>
                    </tr>
                })}
            </table>
        </>
    )
}
